import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css'; // Import CSS cần thiết

const Map = () => {
  const position = [21.028511, 105.804817]; // Tọa độ Hà Nội

  return (
    <MapContainer
      center={position}
      zoom={13}
      style={{ height: '500px', width: '100%' }} // Đặt chiều cao và chiều rộng cho bản đồ
    >
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution="&copy; OpenStreetMap contributors"
      />
      <Marker position={position}>
        <Popup>Hà Nội, Việt Nam</Popup>
      </Marker>
    </MapContainer>
  );
};

export default Map;
